import React, { useState } from "react";
import "../styles/Dashboard.css";

const UserDashboard = () => {
  const [showCallPopup, setShowCallPopup] = useState(false);
  const [showAppointmentPopup, setShowAppointmentPopup] = useState(false);

  const handleCallClick = () => {
    setShowCallPopup(true);
  };

  const handleAppointmentClick = () => {
    setShowAppointmentPopup(true);
  };

  const handlePsychologistSelection = (role) => {
    alert(`${role} has been notified about your appointment request.`);
    setShowAppointmentPopup(false);
  };

  return (
    <div className="dashboard-container">
      <h2>User Dashboard</h2>
      <textarea className="problem-input" placeholder="Explain your problem"></textarea>
      <button className="submit-button">Submit</button>
      <h3>Features:</h3>
      <div className="features-grid">
        <div className="feature-card" onClick={handleCallClick}>
          ðŸ“ž Call & Recordings
        </div>
        <div className="feature-card" onClick={handleAppointmentClick}>
          ðŸ“… Book Appointment
        </div>
      </div>

      {showCallPopup && (
        <div className="popup">
          <h3>Select Call Type</h3>
          <button onClick={() => setShowCallPopup(false)}>Live Voice Call</button>
          <button onClick={() => setShowCallPopup(false)}>Recorded Voice Call</button>
          <button onClick={() => setShowCallPopup(false)}>Live Video Chat</button>
          <button onClick={() => setShowCallPopup(false)}>Recorded Video Chat</button>
        </div>
      )}

      {showAppointmentPopup && (
        <div className="popup">
          <h3>Select Specialist</h3>
          <button onClick={() => handlePsychologistSelection("Psychologist")}>
            Psychologist
          </button>
          <button onClick={() => handlePsychologistSelection("Psychiatrist")}>
            Psychiatrist
          </button>
        </div>
      )}
    </div>
  );
};

export default UserDashboard;
